import { useState } from 'react';
import style from '../css/LoginForm.module.css';

export default function SignUpForm() {
    const [formData, setFormData] = useState({
        id: '',
        password: '',
        confirmPassword: '',
        name: '',
        birth: '',
        phoneNumber: '',
        email: ''
    });

    const [error, setError] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (formData.password !== formData.confirmPassword) {
            setError('Passwords do not match');
            return;
        }

        const { id, password, name, phoneNumber, birth } = formData;

        try {
            const response = await fetch('http://121.139.20.242:5100/api/register', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    user_id: id,
                    user_pw: password,
                    user_name: name,
                    user_num: phoneNumber,
                    user_date: birth
                })
            });

            const result = await response.json();

            if (!response.ok) {
                setError(result.error || 'An unexpected error occurred');
            } else {
                // Handle successful registration, e.g., redirect to login page
                alert('Registration successful!');
            }
        } catch (error) {
            setError('An unexpected error occurred');
            console.error('Error:', error);
        }
    };

    return (
        <div className={style.bg}>
            <form className={style.bg__container} onSubmit={handleSubmit}>
                <p className={style.login__title}>회원가입을 해주세요</p>
                <div className={style.login__input}>
                    {/* 아이디 */}
                    <div className={style.login__input__id}>
                        <p>아이디를 입력해주세요</p>
                        <input type="text" name="id" value={formData.id} onChange={handleChange} />
                    </div>
                    {/* 비밀번호 */}
                    <div className={style.login__input__pw}>
                        <div>
                            <p>비밀번호를 입력해주세요.</p>
                        </div>
                        <div className="pw-input-group">
                            <input type="password" name="password" value={formData.password} onChange={handleChange} />
                        </div>
                    </div>
                    {/* 비밀번호 검증 (다시 입력) */}
                    <div className={style.login__input__pw}>
                        <div>
                            <p>비밀번호를 다시 입력해주세요.</p>
                        </div>
                        <div className="pw-input-group">
                            <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} />
                        </div>
                    </div>
                    {/* 이름 */}
                    <div className={style.login__input__name}>
                        <p>이름을 입력해주세요.</p>
                        <input type="text" name="name" value={formData.name} onChange={handleChange} />
                    </div>
                    {/* 생년 월일 */}
                    <div className={style.login__input__brith}>
                        <p>생년월일을 입력해주세요.</p>
                        <input type="date" name="birth" value={formData.birth} onChange={handleChange} />
                    </div>
                    {/* 전화번호 */}
                    <div className={style.login__input__phoneNumber}>
                        <p>전화번호을 입력해주세요.</p>
                        <input type="tel" name="phoneNumber" value={formData.phoneNumber} onChange={handleChange} />
                    </div>
                    {/* 이메일 */}
                    <div className={style.login__input__email}>
                        <p>이메일을 입력해주세요.</p>
                        <input type="email" name="email" value={formData.email} onChange={handleChange} />
                    </div>
                </div>
                {error && <p className={style.error}>{error}</p>}
                <button className={style.login__loginBtn} type="submit">
                    <p>회원가입</p>
                </button>
            </form>
            <div className={style.register}>
                <div className={style.register__container}>
                    <a className={style.register__title} href="#">
                        로그인 하러 가기
                    </a>
                </div>
            </div>
        </div>
    );
}
